create table processo (
	cod_processo INT PRIMARY KEY,
    num_processo VARCHAR(25),
    tipo VARCHAR(15),
	dt_inicio DATE,
    dt_fim DATE,
    valor DECIMAL (6,2),
	cod_cliente INT,
    cod_adv INT,
	FOREIGN KEY (cod_cliente) REFERENCES cliente (cod_cliente),
	FOREIGN KEY (cod_adv) REFERENCES advogado (cod_adv)
	
);
